/**
 * 登录组件
 * 提供用户登录界面
 */

import React, { useState } from 'react';
import { Form, Button, Checkbox, message } from 'antd';
import { UserOutlined, LockOutlined, WechatOutlined } from '@ant-design/icons';
import { useAuth } from '../../contexts/AuthContext';
import { ForceStyledInput, ForceStyledPasswordInput, ForceStyledFormItem, ForceStyledButton, ForceIconWrapper } from './ForceStyledComponents';
import './Auth.css';
import './GlobalAuthStyles.css';

interface LoginFormData {
  username: string;
  password: string;
  remember?: boolean;
}

interface LoginProps {
  onSwitchToRegister: () => void;
  onLoginSuccess?: () => void;
}

export const Login: React.FC<LoginProps> = ({ onSwitchToRegister, onLoginSuccess }) => {
  const [form] = Form.useForm();
  const [loading, setLoading] = useState(false);
  const { login } = useAuth();

  const handleSubmit = async (values: LoginFormData) => {
    setLoading(true);

    try {
      const success = await login(values.username, values.password);
      if (success) {
        onLoginSuccess?.();
      }
    } catch (error) {
      message.error('登录失败，请重试');
    } finally {
      setLoading(false);
    }
  };

  const handleWechatLogin = () => {
    message.info('微信登录功能开发中，敬请期待！');
  };

  const handleForgotPassword = () => {
    message.info('忘记密码功能开发中，敬请期待！');
  };

  return (
    <>
      <div className="login-header">
        <div className="login-title">欢迎回来</div>
        <div className="login-subtitle">登录您的账户以继续使用</div>
      </div>

      <Form
        form={form}
        name="login"
        onFinish={handleSubmit}
        layout="vertical"
        className="login-form"
        autoComplete="off"
      >
        <div className="form-group">
          <label className="form-label">用户名</label>
          <ForceStyledFormItem
            name="username"
            rules={[
              { required: true, message: '请输入用户名或邮箱' },
              { min: 3, message: '用户名至少需要3个字符' },
            ]}
          >
            <div className="input-wrapper">
              <ForceStyledInput
                placeholder="请输入用户名或邮箱"
                prefix={<ForceIconWrapper><UserOutlined /></ForceIconWrapper>}
              />
            </div>
          </ForceStyledFormItem>
        </div>

        <div className="form-group">
          <label className="form-label">密码</label>
          <ForceStyledFormItem
            name="password"
            rules={[
              { required: true, message: '请输入密码' },
              { min: 6, message: '密码至少需要6个字符' },
            ]}
          >
            <div className="input-wrapper">
              <ForceStyledPasswordInput
                placeholder="请输入密码"
                prefix={<ForceIconWrapper><LockOutlined /></ForceIconWrapper>}
              />
            </div>
          </ForceStyledFormItem>
        </div>

        <div className="form-options">
          <Form.Item name="remember" valuePropName="checked">
            <Checkbox className="remember-me">记住我</Checkbox>
          </Form.Item>
          <Button type="link" className="forgot-password" onClick={handleForgotPassword}>
            忘记密码？
          </Button>
        </div>

        <Form.Item>
          <ForceStyledButton
            type="primary"
            htmlType="submit"
            loading={loading}
            block
          >
            {loading ? (
              <>
                <span className="loading"></span>
                登录中...
              </>
            ) : (
              <span className="button-text">登录</span>
            )}
          </ForceStyledButton>
        </Form.Item>
      </Form>

      <div className="social-login">
        <div className="divider">
          <span>或使用以下方式登录</span>
        </div>
        <div className="social-buttons">
          <Button 
            className="social-button wechat-button" 
            onClick={handleWechatLogin}
            icon={<WechatOutlined />}
          >
            微信登录
          </Button>
        </div>
      </div>

      <div className="register-link">
        还没有账号？
        <Button type="link" onClick={onSwitchToRegister} className="register-btn">
          立即注册
        </Button>
      </div>
    </>
  );
};
